import React from 'react'
import { withStyles } from "@material-ui/styles";
//
import Colors from "../Constant/Colors";

const styles = {
  root: {
    width: "100%",
    height: "600px",
    borderRadius: "8px",
    overflow: "hidden",
    background: "white",
    marginTop: "48px",
  },

};

function ExpandableImage(props) {

  const { classes, image } = props;
  return (
    <div className={classes.root}>
      <img src={image} />

      <div className={classes.expandPart}>
        <div>X</div>
        <img src={image} />
      </div>
    </div>
  )
}

export default withStyles(styles)(ExpandableImage);
